css:
atom-text-editor,
:host {
  background-color: #ffffff;
  color: #333333;
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #cccccc;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  color: #cccccc;
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background-color: #cccccc;
}
atom-text-editor .gutter,
:host .gutter {
  background-color: #cccccc;
}
atom-text-editor .gutter .cursor-line,
:host .gutter .cursor-line {
  background-color: #eeeeee;
}
atom-text-editor .line-number.cursor-line-no-selection,
:host .line-number.cursor-line-no-selection {
  background-color: #eeeeee;
}
atom-text-editor .invisible,
:host .invisible {
  color: #333333;
}
atom-text-editor .cursor,
:host .cursor {
  border-color: #333333;
}
atom-text-editor .selection .region,
:host .selection .region {
  background-color: #6699cc;
}
atom-text-editor .search-results .marker .region,
:host .search-results .marker .region {
  background-color: transparent;
  border: 1px solid #444444;
}
atom-text-editor .search-results .marker.current-result .region,
:host .search-results .marker.current-result .region {
  border: 1px solid #000000;
}
atom-text-editor .gfm .markup.heading,
:host .gfm .markup.heading {
  color: #A6E22E;
  font-weight: bold;
}
atom-text-editor .gfm .markup.underline,
:host .gfm .markup.underline {
  color: #E6DB74;
  text-decoration: underline;
}
atom-text-editor .gfm .bold,
:host .gfm .bold {
  font-weight: bold;
}
atom-text-editor .gfm .italic,
:host .gfm .italic {
  font-style: italic;
}
atom-text-editor .gfm .raw,
:host .gfm .raw {
  color: #66D9EF;
}
atom-text-editor .gfm .variable.list,
:host .gfm .variable.list {
  color: #F92672;
  font-weight: bold;
}
atom-text-editor .gfm .link,
:host .gfm .link {
  color: #CCC;
}
atom-text-editor .gfm .link .entity,
:host .gfm .link .entity {
  color: #AE81FF;
}
.comment {
  color: #75715E;
}
.string {
  color: #E6DB74;
}
.constant.numeric {
  color: #AE81FF;
}
.constant.language {
  color: #AE81FF;
}
.constant.character,
.constant.other {
  color: #AE81FF;
}
.keyword {
  color: #F92672;
}
.storage {
  color: #F92672;
}
.storage.type {
  font-style: italic;
  color: #66D9EF;
}
.entity.name.class {
  text-decoration: none;
  color: #A6E22E;
}
.entity.other.inherited-class {
  font-style: italic;
  text-decoration: none;
  color: #A6E22E;
}
.leading-whitespace,
.trailing-whitespace {
  display: inline-block;
}
.entity.name.function {
  color: #A6E22E;
}
.entity.name.instance {
  color: #66D9EF;
}
.variable.parameter {
  font-style: italic;
  color: #FD971F;
}
.entity.name.tag {
  color: #F92672;
}
.entity.other.attribute-name {
  color: #A6E22E;
}
.support.function {
  color: #66D9EF;
}
.support.constant {
  color: #66D9EF;
}
.support.type,
.support.class {
  font-style: italic;
  color: #66D9EF;
}
.invalid {
  color: #F8F8F0;
  background-color: #F92672;
}
.invalid.deprecated {
  color: #F8F8F0;
  background-color: #AE81FF;
}
.class.jade {
  color: #AE81FF;
}
.variable.language.js {
  color: #F92672;
}
